header.script:
	var global_contact_quiz_index = null;
	var contact_init = function () {
		var contact = $('.contact');
		var contact_bt = $('.contact_bt');
		var goorm_title = $('#contact_us_title');
		var goorm_email = $('#contact_us_email');
		var goorm_content = $('#contact_us_content');
		var goorm_env = $('#contact_us_env');
		var goorm_title_form = goorm_title.parents('.form-group');
		var goorm_email_form = goorm_email.parents('.form-group');
		var goorm_content_form = goorm_content.parents('.form-group');
		var goorm_env_form = goorm_env.parents('.form-group');
		var goorm_submit = $('.contact_goorm_send');

		var goorm_wait = $('#goorm-info-send-wait');
		var goorm_success = $('#goorm-info-send-success');
		var goorm_fail = $('#goorm-info-send-fail');
		var goorm_fail_no_email = $('#goorm-info-send-fail-no-email');



		// var facebook = $('.facebook_contact');
		var user_agent = navigator.userAgent;


		var initial_contact_height = $('.contact').height();

		if (/mobile/i.test(user_agent) || /android/i.test(user_agent)) {
			contact.css('overflow', 'scroll');
			initial_contact_height = 525;
			var $header_menu = $('.header_tool ul.dropdown-menu');
			$header_menu.find('a[href="/manage/my"]').hide();
			$header_menu.find('li.divider').before('
검색');
			$header_menu.find('li.divider').after('
문의하기');

			$('.contact_mobile_bt').click(function () {
				$('.contact').show();
			});

			$('.contact .close').click(function () {
				$('.contact').hide();
			});
		}

		var resize = function () {
			var contact_height = initial_contact_height + 20;
			var window_height = $(window).height() - 100;	// 100 means button

			if (contact_height > window_height) {
				contact.outerHeight(window_height);	
			} else {
				contact.height(initial_contact_height);
			}
		};

		$(window).resize(function () {
			resize();
		});

		contact.click(function () {
			return false;
		});

		//manual tab implementation
		$('.contact .nav-tabs li a').click(function(){
			var clicked_tab = $(this);
			$('.contact .nav-tabs li').removeClass('active')
			clicked_tab.parent().addClass('active')

			$('.contact .tab-content div').removeClass('active').removeClass('in');
			$(clicked_tab.attr('href')).addClass('active').addClass('in');
			resize();
		});


		goorm_submit.click(function () {
			var error = false;
			var need_input = false;
			var title_val = goorm_title.val();
			var email_val = goorm_email.val();
			var content_val = goorm_content.val();
			var env_val = goorm_env.val();

			if (!title_val) {
				goorm_title_form.addClass('has-error');
				error = true;
				need_input = true;
			}

			if (goorm_email_form.length !== 0) {
				if (!email_val) {
					goorm_email_form.addClass('has-error');
					error = true;
					need_input = true;
				} else {
					var email_pattern = /^([0-9a-zA-Z._-]+)@([0-9a-zA-Z_-]+)(\.[a-zA-Z0-9]+)(\.[a-zA-Z0-9]+)?(\.[a-zA-Z]+)?$/;
					if (email_pattern.test(email_val) === false) {
						goorm_email_form.addClass('has-error');
						error = true;

						$('#goorm-info-email-wrong').show();
						goorm_submit.hide();

						setTimeout(function () {
							goorm_submit.show();
							$('#goorm-info-email-wrong').hide();
						}, 3000);
						return;
					}
				}
			}

			if (!content_val) {
				goorm_content_form.addClass('has-error');
				error = true;
				need_input = true;
			}

			if (need_input) {
				$('#goorm-info-need-input').show();
				goorm_submit.hide();

				setTimeout(function () {
					goorm_submit.show();
					$('#goorm-info-need-input').hide();
				}, 3000);
			}
			if (!error) {
				// facebook.hide();
				goorm_wait.show();
				$(this).hide();

				$.post('/contact', {
					'title': title_val,
					'email': email_val,
					'content': content_val,
					'env': env_val,
					'url': location.href,
					'user_agent': navigator.userAgent,
					'resolution': window.screen.availWidth + ' X ' + window.screen.availHeight
				}, function (result) {
					if(result.result) {
						goorm_success.show();

						setTimeout(function () {
							if (/mobile/i.test(user_agent) || /android/i.test(user_agent)) {
								$('.contact .close').click();
							} else {
								contact_bt.click();
							}

							goorm_title.val('');
							goorm_content.val('');
							goorm_env.val('');

							goorm_submit.show();
							goorm_success.hide();
							// facebook.show();
						}, 3000);
					} else {
						// facebook.hide();
						if (result.no_email) {
							goorm_fail_no_email.show();
						} else {
							goorm_fail.show();
						}

						setTimeout(function () {
							goorm_submit.show();
							if (result.no_email) {
								goorm_fail_no_email.hide();
							} else {
								goorm_fail.hide();
							}
							// facebook.show();
						}, 3000);
					}

					goorm_wait.hide();
				});
			}
		});



		// facebook.click(function () {
		// 	window.open('https://www.facebook.com/groups/goorm.edu/');
		// });

		$('#contact_us_title, #contact_us_content, #contact_us_env, #contact_us_email').keydown(function () {
			$(this).parents('.form-group').removeClass('has-error');
		});

		resize();	
	};

var nav_mobile_toggle = document.getElementsByClassName('navbar-toggle');
var nav_collapse = document.getElementById('nav_menu');

nav_mobile_toggle[0].onclick = function() {
	var i_tag = this.childNodes[1];
	if (nav_collapse && i_tag && i_tag.tagName && i_tag.tagName.toLowerCase() === 'i') {
		if (nav_collapse.getAttribute('aria-expanded') === 'true') {
			i_tag.className = i_tag.className.replace('fa-times', 'fa-bars');
		} else {
			i_tag.className = i_tag.className.replace('fa-bars', 'fa-times');

		}
	}
};

var xmlhttp=new XMLHttpRequest();
xmlhttp.open("GET", '/organization/white_logo');
xmlhttp.onreadystatechange = function() {
	if (xmlhttp.readyState == XMLHttpRequest.DONE) {
		if(xmlhttp.status == 200){
			var response = xmlhttp.responseText;

			if (response[0] === '{') {
				response = JSON.parse(xmlhttp.responseText);
				if(response.new_logo) {
					if (document.getElementsByClassName('ch_logo').length) {
						document.getElementsByClassName('ch_logo')[0].src = response.new_logo;
						document.getElementsByClassName('ch_logo')[0].style.display = 'inline-block';
					}
				} else {
					if (document.getElementsByClassName('ch_logo').length) {
						document.getElementsByClassName('ch_logo')[0].style.visibility = 'hidden';
					}
					if (document.getElementsByClassName('ch_name_logo').length) {
						document.getElementsByClassName('ch_name_logo')[0].innerHTML = response.name;
					}
				}
			} else {
				if (document.getElementsByClassName('ch_logo').length) {
					document.getElementsByClassName('ch_logo')[0].style.display = 'inline-block';
				}
			}
		}
	}
}
xmlhttp.send();

